import * as React from 'react';
import Typography from '@mui/material/Typography';
import Pagination from '@mui/material/Pagination';
import Stack from '@mui/material/Stack';
import { lighten, makeStyles } from '@material-ui/core/styles';
const useToolbarStyles = makeStyles((theme) => ({
    root: {
        paddingLeft: theme.spacing(2),
        paddingRight: theme.spacing(1),
        //color
        backgroundColor: theme.palette.divider
    },
    li: {
        flex: '1 1 100%',
        height: "300px",
        margin: '30px' ,
        backgroundColor: theme.primary,
        fontSize: 60,
    },
}));

const Photo = () => {
    const [page, setPage] = React.useState(1);
    const handleChange = (event, value) => {
        setPage(value);
        console.log(value)
    };
    const classes = useToolbarStyles();
    
    return (
        <section id="Activity">
            <div class="projects container">
                <div class="projects-header">
                    <h1 class="section-title"> Activities <span></span></h1>
                </div>
                <div class="all-Photo">
                    <div class="project-item">
                        <div class="Photo-img">
                            <img src="https://i.ibb.co/nPcy5H7/S-86638597.jpg" alt="img" />
                        </div>
                    </div>
                </div>
                <div class="page">
                    <Stack spacing={2} >
                        {/* <Typography>Page: {page}</Typography> */}
                        <Pagination className={classes.li} style={{ fontSize: 60, color: '#ffff' }} count={10} page={page} onChange={handleChange}/>
                    </Stack>
                </div>
            </div>
        </section>
    )
}
export default Photo
